import React from 'react';
import {Link} from "react-router-dom";

export default function Nav() {
    return (
        <header>
        <nav>
            <div className="logo-container">
            </div>
            <ul className="nav-links">
                <li>About Us</li>
                <li>Contact Us</li>
            </ul>
        </nav>
        </header>
    )
}
